{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/siddhantpadale/air-quality-analysis-of-india-comparative-study?scriptVersionId=127430958\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"ea2db763","metadata":{"execution":{"iopub.execute_input":"2023-04-26T17:13:11.328306Z","iopub.status.busy":"2023-04-26T17:13:11.326742Z","iopub.status.idle":"2023-04-26T17:13:11.347073Z"},"papermill":{"duration":0.008963,"end_time":"2023-04-27T09:48:27.770015","exception":false,"start_time":"2023-04-27T09:48:27.761052","status":"completed"},"tags":[]},"source":["# **Introduction**\n","\n","India has some of the highest levels of air pollution in the world, with several cities frequently ranking among the most polluted cities. According to the World Air Quality Report 2020 by IQAir, 22 out of the top 30 most polluted cities globally were in India. \n","\n","Vehicular emissions, industrial emissions, construction dust, crop residue burning, and solid waste burning are major sources of air pollution in India.\n","\n","According to a study published in The Lancet Planetary Health in 2017, outdoor air pollution was responsible for *over 1.2 million premature deaths in India in 2015*, with respiratory diseases being one of the major causes. (The Lancet Planetary Health (2017). The Lancet Commission on pollution and health. Retrieved from: https://www.thelancet.com/commissions/pollution-and-health)\n","\n","The Indian government has taken steps to address air pollution, such as implementing stricter emission norms, promoting clean energy sources, and banning certain practices. However, enforcement and implementation remain challenging, which is a common issue in many countries globally.\n","\n","A comparative analysis of various states in India can give us useful insight into governmental policies and their implementations. \n"]},{"cell_type":"code","execution_count":1,"id":"3528b2e3","metadata":{"execution":{"iopub.execute_input":"2023-04-27T09:48:27.79Z","iopub.status.busy":"2023-04-27T09:48:27.787349Z","iopub.status.idle":"2023-04-27T09:48:28.894906Z","shell.execute_reply":"2023-04-27T09:48:28.893228Z"},"papermill":{"duration":1.12045,"end_time":"2023-04-27T09:48:28.89787","exception":false,"start_time":"2023-04-27T09:48:27.77742","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.0     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.1     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.1.8\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n"]}],"source":["library(tidyverse)\n","library(ggplot2)"]},{"cell_type":"markdown","id":"8661ad74","metadata":{"papermill":{"duration":0.007417,"end_time":"2023-04-27T09:48:28.913068","exception":false,"start_time":"2023-04-27T09:48:28.905651","status":"completed"},"tags":[]},"source":["# **Data cleanin