000 1000 1000\n","2 Rajasthan     1000 1000 1000 1000 1000 1000 1000\n","3 Uttar Pradesh 1000 1000 1000 1000 1000 1000 1000"]},"metadata":{},"output_type":"display_data"}],"source":["selected_states<- c(\"Maharashtra\", \"Uttar Pradesh\", \"Rajasthan\")\n","\n","data_required <- data_clean %>% \n","  select(\"state\", \"so2\", \"no2\", \"rspm\", \"spm\", \"date\", \"year\") %>% \n","  filter(state %in% selected_states, year < 2011, year > 2003)\n","\n","#Random Purposive Sampling\n","data_sampled <- data_required %>% \n","  group_by(state, year) %>% \n","  slice_sample(n = 1000) \n","\n","\n","total_counts_per_state1 <- data_sampled %>%\n","  group_by(year, state) %>%\n","  summarise(total_counts = n()) %>%\n","  arrange(year)\n","wide_total_counts_per_state1 <- total_counts_per_state1 %>% \n","  pivot_wider(names_from = year, values_from = total_counts, values_fill = 0)\n","head(wide_total_counts_per_state1)"]},{"cell_type":"markdown","id":"beecf399","metadata":{"papermill":{"duration":0.00914,"end_time":"2023-04-27T09:48:31.928976","exception":false,"start_time":"2023-04-27T09:48:31.919836","status":"completed"},"tags":[]},"source":["#  **Data Analysis**"]},{"cell_type":"markdown","id":"5feaae9c","metadata":{"papermill":{"duration":0.009016,"end_time":"2023-04-27T09:48:31.94717","exception":false,"start_time":"2023-04-27T09:48:31.938154","status":"completed"},"tags":[]},"source":["**Comparative analysis of each of SO2, NO2, RSPM and SPM in three states from 2004 to 2010**\n","\n","From the column chart below, we can find the comparison of each pollutant concentration from each state as well as a comparison of concentration pollutants in the state."]},{"cell_type":"code","execution_count":8,"id":"bd8cfe2f","metadata":{"execution":{"iopub.execute_input":"2023-04-27T09:48:31.969337Z","iopub.status.busy":"2023-04-27T09:48:31.967666Z","iopub.status.idle":"2023-04-27T09:48:32.617073Z","shell.execute_reply":"2023-04-27T09:48:32.614382Z"},"papermill":{"duration":0.663771,