 , \" (\\u03bcg/m\"^\"3\",\")\")), title = \"Comparision of States and its Pollutants\")"]},{"cell_type":"markdown","id":"ee95b510","metadata":{"papermill":{"duration":0.009614,"end_time":"2023-04-27T09:48:32.639634","exception":false,"start_time":"2023-04-27T09:48:32.63002","status":"completed"},"tags":[]},"source":["**Trends of SO2, NO2, RSPM AND SPM pollutants in three states from 2003 to 2010**"]},{"cell_type":"code","execution_count":9,"id":"b61a2f4c","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2023-04-27T09:48:32.66186Z","iopub.status.busy":"2023-04-27T09:48:32.660297Z","iopub.status.idle":"2023-04-27T09:48:32.872472Z","shell.execute_reply":"2023-04-27T09:48:32.870679Z"},"papermill":{"duration":0.225864,"end_time":"2023-04-27T09:48:32.87492","exception":false,"start_time":"2023-04-27T09:48:32.649056","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'state'. You can override using the\n","`.groups` argument.\n","\u001b[1m\u001b[22m`summarise()` has grouped output by 'state'. You can override using the\n","`.groups` argument.\n","\u001b[1m\u001b[22m`summarise()` has grouped output by 'state'. You can override using the\n","`.groups` argument.\n","\u001b[1m\u001b[22m`summarise()` has grouped output by 'state'. You can override using the\n","`.groups` argument.\n"]}],"source":["#Creating data frame with values of pollutants and their yearly avg.\n","# FOR SO2\n","df_meanso2 <- data_sampled %>% \n","  group_by(state, year) %>% \n","  summarise(avg_so2 = mean(so2))\n","\n","# FOR NO2\n","df_meanno2 <- data_sampled %>% \n","  group_by(state, year) %>% \n","  summarise(avg_no2 = mean(no2))\n","\n","# FOR RSPM\n","df_meanrspm <- data_sampled %>% \n","  group_by(state, year) %>% \n","  summarise(avg_rspm = mean(rspm))\n","\n","# FOR SPM\n","df_meanspm <- data_sampled %>% \n","  group_by(state, year) %>% \n","  summarise(avg_spm = mean(spm))\n","\n","#Using join function to create the main table \n","mean_table <- inner_join(df_meanso2, df_meanno2, by = c(\"state\", \"year\")) %>% \n","  inner_join(df_meanrspm, by = c(\"state\", \"year\")) %>% \n","  inner_join(df_meanspm, by = c(\"state\", \"year\"))\n","\n","#for the trends of pollutants over time\n","meanofpollutants_per_year <- mean_table %>% \n","  group_by(year) %>% \n","  summarise(total_avg_so2 = mean(avg_so2), total_avg_no2 = mean(avg_no2), total_avg_rspm = mean(avg_rspm), total_avg_spm = mean(avg_spm))"]},{"cell_type":"markdown","id":"06d0c30d","metadata":{"papermill":{"duration":0.010747,"end_time":"2023-04-27T09:48:32.895727","exception":false,"start_time":"2023-04-27T09:48:32.88498","status":"completed"},"tags":[]},"source":["**Sulphur Dioxide (SO2)**\n","\n","SO2 is a toxic gas that is released primarily from burning fossil fuels, such as coal and oil, in industrial processes and power generation. Its emissions contribute to the formation of acid rain, which has detrimental effects on soil, water bodies, vegetation, and buildings. Acid rain can also harm aquatic ecosystems, including fish and other aquatic organisms.\n","\n","SO2 can cause respiratory problems, such as coughing, wheezing, and shortness of breath, especially in individuals with pre-existing respiratory conditions like asthma. It can also worsen existing heart and lung conditions.\n"]},{"cell_type":"markdown","id":"864b1132","metadata":{"papermill":{"duration":0.009828,"end_time":"2023-04-27T09:48:32.915524","exception":false,"start_time":"2023-04-27T09:48:32.905696","status":"completed"},"tags":[]},"source":["**1.  \tSO2 trend from 2004 to 2010**"]},{"cell_type":"code","execution_count":10,"id":"2acf3fa0","metadata":{"execution":{"iopub.execute_input":"2023-04-27T09:48:32.938768Z","iopub.status.busy":"2023-04-27T09:48:32.937181Z","iopub.status.idle":"2023-04-27T09:48:33.233211Z","shell.execute_reply":"2023-04-27T09:48:33.231472Z"},"papermill":{"duration":0.310426,"end_time":"2023