ended Particulate Matter (RSPM)**\n","\n","RSPM refers to tiny solid particles suspended in the air, which are small enough to be inhaled into the lungs. It includes particles with a diameter of 10 microns or less (PM10), which can come from sources like vehicle emissions, construction dust, and industrial emissions. \n","\n","PM10 can have adverse effects on respiratory health, causing respiratory symptoms like coughing, sneezing, and shortness of breath. Long-term exposure to PM10 has been linked to chronic respiratory conditions, cardiovascular problems, and even premature death.\n"]},{"cell_type":"markdown","id":"e2c234ad","metadata":{"papermill":{"duration":0.015632,"end_time":"2023-04-27T09:48:34.755568","exception":false,"start_time":"2023-04-27T09:48:34.739936","status":"completed"},"tags":[]},"source":["**1.\tRSPM  trend from 2004 to 2010**"]},{"cell_type":"code","execution_count":14,"id":"20d1da1f","metadata":{"execution":{"iopub.execute_input":"2023-04-27T09:48:34.791826Z","iopub.status.busy":"2023-04-27T09:48:34.790189Z","iopub.status.idle":"2023-04-27T09:48:35.065372Z","shell.execute_reply":"2023-04-27T09:48:35.06354Z"},"papermill":{"duration":0.296342,"end_time":"2023-04-27T09:48:35.067549","exception":false,"start_time":"2023-04-27T09:48:34.771207","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd0ATZx8H8N9lAgl7qCAuXDjr3nvULVoVNzJta7W2Vmq1dmtbbX3raFVAhlvc\n27pwW+u21r3qVhDZIyG594/TGMIwhIRLwvfzl1wud98899zl540nDMuyBAAAAACWT8B3AAAA\nAAAwDhR2AAAAAFYChR0AAACAlUBhBwAAAGAlUNgBAAAAWAkUdgAAAABWAoUdAAAAgJVAYQcA\nAABgJcpdYceqM2vbSRiGEQglZzKUfMcxU1lPEwK7NXOTSyrUn17MbPVlEqYAgUBk7+TepEOf\nH6L2qssscX5nv3iHYZjehx+XflETvewZhrmWnVfMPJd+bsEwTLet90q/OiJS5dxf9uOnPdo2\ncnd2EIskDq6ezToPmLkwPlVl5WOJ/8/HmWGYXS9zymBRnlJRgX4rkDk412/Vfcaijbkma2kj\n9kxtxu2BJZV8fRTXhi51Zhc5kzqn7uvDRUJqbhmmKxVF6gkfW/EPF15ophhw0NN/j9azWxrW\n4Kw6c6CHbNCSy6VvFqO7Ee3HMIxAaLPmUWahM7B5Kd1cbBmG8Q3bWcbZLB